import React from 'react';
import {Link, useHistory} from "react-router-dom";
import quizImg from './quiz.png';
import Button from "react-bootstrap/Button";

class Game extends React.Component {
    constructor(props) {
        super(props);
        this.setQuiz = this.setQuiz.bind(this);
        this.routeChange = this.routeChange.bind(this);
    }

    routeChange() {
        let path = `/doQuiz`;
        // eslint-disable-next-line react-hooks/rules-of-hooks
        let history = useHistory();
        history.push(path);
    }

    setQuiz() {
        this.props.setQuiz(this.props.quiz);
        this.routeChange()
    }

    render() {
        return (
            <div className="GameLink">
                <div className="image-container">
                    <img src={quizImg} alt='ai photo'/>
                </div>
                <div className="quiz">
                    <h5>{this.props.quiz}</h5>
                </div>
                <div className="linkButton">
                    <Button onClick={this.setQuiz}>Do Quiz</Button>
                </div>
            </div>)
    }

}

export default Game;
